const botPrefix = tempVars('botPrefix');
var reactionArray = [];
var rectarray = globalVars('reactionRoleInf');
const _this = this;
var tempRole;
var emojiArray = [];
var roleArray = [];

msg.channel.send(`Witaj w ustawieniach autoroli.\nProszę teraz podać wzmiankę lub nazwę roli (wielkość liter ma znaczenie) wraz z emotką.\nNp. @rola/rola ✅`)
    .then((message) => {
        msg.channel.awaitMessages(response => response.author.id == msg.author.id, {
                max: 1,
                time: 60000,
                errors: ['time'],
            })
            .then(async function(collected) {
                msg.author.lastMessage.delete();
                if (collected.first().content.split(/ +/g).length > 1) {
                    if (collected.first().content.split(/ +/g)[0] != null) {
                        const tstValidRole = await msg.guild.roles.find(role => role.name === collected.first().content.split(/ +/g)[0]);
                        if (collected.first().mentions.roles.first() || tstValidRole != null) {
                            var unicodeStored = collected.first().content.split(/ +/g)[1];
                            var roleMentioned;
                            if (collected.first().mentions.roles.first() != null) {
                                roleMentioned = collected.first().mentions.roles.first();
                            } else {
                                roleMentioned = tstValidRole;
                            }
                            if (unicodeStored.charCodeAt(0 > 127)) {
                                reactionArray.push([unicodeStored, roleMentioned.id, roleMentioned.name]);
                                emojiArray.push(unicodeStored);
                                roleArray.push(roleMentioned.id);
                                message.edit(`Wybrałeś/aś rolę **${roleMentioned.name}** na reakcję ${unicodeStored}.\nJeśli wszystko się zgadza proszę wpisać "potwierdz".\nJeśli nie proszę pisać "anuluj", aby anulować akcję.`);
                                msg.channel.awaitMessages(response => response.author.id == msg.author.id, {
                                        max: 1,
                                        time: 60000,
                                        errors: ['time'],
                                    })
                                    .then((collected) => {
                                        msg.author.lastMessage.delete();
                                        if (collected.first().content.toLowerCase() == "potwierdz") {
                                            reAsk(message)
                                        } else if (collected.first().content.toLowerCase() == "anuluj") {
                                            message.delete();
                                            msg.channel.send("Akcja została anulowana.\nProszę wpisać komendę ponownie, aby spróbować ustawić !");
                                        } else {
                                            message.delete();
                                            msg.channel.send("Akcja została odwołana, podałeś/aś niepoprawne dane!\nProszę wpisać komendę ponownie, aby spróbować ustawić !");
                                        }
                                    }).catch(() => {
                                        message.delete();
                                        msg.channel.send('Niestety czas na podanie danych się skończył.\nProszę wpisać komendę ponownie, aby spróbować ustawić !');
                                    });
                            } else {
                                message.delete();
                                msg.channel.send("Akcja została odwołana, podałeś/aś niepoprawną emotkę!\nProszę wpisać komendę ponownie, aby spróbować ustawić !");
                            }

                        } else {
                            message.delete();
                            msg.channel.send("Akcja została odwołana, podałeś/aś niepoprawną odpowiedź!\nProszę wpisać komendę ponownie, aby spróbować ustawić !");
                        }
                    } else {
                        message.delete();
                        msg.channel.send("Akcja została odwołana, podałeś/aś niepoprawną rolę!\nProszę wpisać komendę ponownie, aby spróbować ustawić !");
                    }
                } else {
                    message.delete();
                    msg.channel.send("Akcja została odwołana, nie podałeś/aś reakcji/roli!\nProszę wpisać komendę ponownie, aby spróbować ustawić !");
                }
            }).catch((error) => {
                console.log(error);
                message.delete();
                msg.channel.send('Czas na podanie danych się skończył!\nProszę wpisać komendę ponownie, aby spróbować ustawić !');
            });
    })

function reAsk(message) {
    if (reactionArray.length != 10) {
        var finalText = "";
        reactionArray.forEach(subarray => {
            finalText = finalText + `${subarray[0]} => ${subarray[2]}\n`
        })
        message.edit(`Do tej pory masz tyle roli na reakcję (max 10)\n ${finalText}\n\nJeśli chcesz dołączyć kolejną rolę na reakcję wpisz rolę wraz z reakcją jak poprzednio.\nJeśli nie proszę wpisać "koniec".\nJeśli chcesz anulować wpisz "anuluj"`);
        msg.channel.awaitMessages(response => response.author.id == msg.author.id, {
                max: 1,
                time: 60000,
                errors: ['time'],
            })
            .then(async function(collected) {
                msg.author.lastMessage.delete();
                if (collected.first().content.toLowerCase() == "koniec") {
                    done(message)
                } else if (collected.first().mentions.roles.first() == "anuluj") {
                    message.delete();
                    msg.channel.send("Akcja została odwołana.\nProszę wpisać komendę ponownie, aby spróbować ustawić !");
                } else {
                    if (collected.first().content.split(/ +/g).length > 1) {
                        const tstValidRole = await msg.guild.roles.find(role => role.name === collected.first().content.split(/ +/g)[0]);
                        if (collected.first().mentions.roles.first() || tstValidRole != null) {
                            var unicodeStored = collected.first().content.split(/ +/g)[1];
                            if (collected.first().mentions.roles.first() != null) {
                                roleMentioned = collected.first().mentions.roles.first();
                            } else {
                                roleMentioned = tstValidRole;
                            }
                            if (unicodeStored != null) {
                                if (!emojiArray.includes(unicodeStored)) {
                                    if (!roleArray.includes(roleMentioned.id)) {
                                        if (unicodeStored.charCodeAt(0 > 127)) {
                                            reactionArray.push([unicodeStored, roleMentioned.id, roleMentioned.name]);
                                            emojiArray.push(unicodeStored);
                                            roleArray.push(roleMentioned.id);
                                            reAsk(message)
                                        } else {
                                            message.delete();
                                            msg.channel.send("Akcja została odwołana, podałeś reakcję, która została już użyta!\nProszę wpisać komendę ponownie, aby spróbować ustawić !");
                                        }
                                    } else {
                                        message.delete();
                                        msg.channel.send("Akcja została odwołana, podałeś/aś rolę, która została użyta!\nProszę wpisać komendę ponownie, aby spróbować ustawić !");
                                    }
                                } else {
                                    message.delete();
                                    msg.channel.send("Akcja została odwołana, podałeś/aś niepoprawną reakcję!\nProszę wpisać komendę ponownie, aby spróbować ustawić !");
                                }
                            }
                        } else {
                            message.delete();
                            msg.channel.send("Akcja została odwołana, podałeś/aś nieprawidłową rolę!\nProszę wpisać komendę ponownie, aby spróbować ustawić !");
                        }
                    } else {
                        message.delete();
                        msg.channel.send("Akcja została odwołana, podałeś/aś nieprawidłową reakcję/rolę!\nProszę wpisać komendę ponownie, aby spróbować ustawić !");
                    }
                }
            }).catch(() => {
                message.delete();
                msg.channel.send('Czas na podanie danych się skończył!\nProszę wpisać komendę ponownie, aby spróbować ustawić !');
            });
    } else {
        done(message);
    }

}

function done(message) {
    var finalText = "";
    reactionArray.forEach(subarray => {
        finalText = finalText + `${subarray[0]} => ${subarray[2]}\n`
    })
    message.edit(`Ostateczna konfiguracja menu\n\nPoniżej znajduje się lista ustawionych reakcji na rolę\n${finalText}\n\nJeśli jest poprawna proszę wpisać wzmiankę kanału (na tym serwerze),  na którym ma zostać wysłanne menu z rolami.\nJeśli menu nie jest poprawne proszę anulować wpisując "anuluj".`)
    msg.channel.awaitMessages(response => response.author.id == msg.author.id, {
            max: 1,
            time: 60000,
            errors: ['time'],
        })
        .then((collected) => {
            msg.author.lastMessage.delete();
            if (collected.first().mentions.channels.first()) {
                var menchannel = collected.first().mentions.channels.first()
                message.delete();
                menchannel.send({
                        embed: {
                            color: 0xffff00,
                            title: "Menu Roli",
                            description: `Zareaguj, na którąś z poniższych reackji, aby otrzymać przypisaną do niej rolę\n${finalText}`,
                            timestamp: new Date()
                        }
                    })
                    .then(embedmessage => {
                        reactionArray.forEach(async function(subarray) {
                            await embedmessage.react(subarray[0])
                        })
                        rectarray.push({
                            [embedmessage.id]: reactionArray
                        })
                        _this.storeValue(rectarray, 3, "reactionRoleInf", cache);
                        _this.callNextAction(cache);
                    })
            } else if (collected.first().content == "anuluj") {
                message.delete();
                msg.channel.send("Akcja została anulowana.\nProszę wpisać komendę ponownie, aby spróbować ustawić !");
            } else {
                message.delete();
                msg.channel.send("Akcja została anulowana, Nie podałeś/aś poprawnych danych!\nProszę wpisać komendę ponownie, aby spróbować ustawić !");
            }
        }).catch(() => {
            message.delete();
            msg.channel.send('Czas na podanie danych minął!\nProszę wpisać komendę ponownie, aby spróbować ustawić !');
        });
}

const fs = require('fs');
