    fs.readFile('./resources/serverRoleMenu.json', function read(err, data) {
        if (err) {
            throw err;
        }

        var newData = JSON.parse(data);
        newData[msg.guild.id] = chnlID;

        fs.writeFile('./resources/serverRoleMenu.json', JSON.stringify(newData), (err) => {  
            if (err) {
                console.log(err);
            }
        });

    })

} else {
    fs.writeFile('./resources/serverRoleMenu.json', '{}', (err) => {  
        if (err) {
            console.log(err);
        }

        fs.readFile('./resources/serverRoleMenu.json', function read(err, data) {
            if (err) {
                throw err;
            }

            var newData = JSON.parse(data);
            newData[msg.guild.id] = chnlID;

            fs.writeFile('./resources/serverRoleMenu.json', JSON.stringify(newData), (err) => {  
                if (err) {
                    console.log(err);
                }
            });
        })
    });
}

